import React from 'react';
import { NavigationContainer, createSwitchNavigator } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import PrepareToLogin from './pages/PrepareToLogin';
import Home from './pages/Home';
import LinkExpo from './pages/LinkExpo';
import CallBack from './pages/CallBack';
import Login from './pages/Login';

const Stack = createStackNavigator();

export default () => {
  const prefix = 'myapp://';
  return (
    <NavigationContainer uriPrefix={prefix}>
    <Stack.Screen name="Home" component={Home} options={{ headerTitle: "Home", path: 'home' }} />
    <Stack.Screen name="PrepareToLogin" component={PrepareToLogin} options={{ headerTitle: "PrepareToLogin", path: 'preparetologin' }} />
    <Stack.Screen name="LinkExpo" component={LinkExpo} options={{ headerTitle: "LinkExpo", path: 'linkexpo' }} />
    <Stack.Screen name="CallBack" component={CallBack} options={{ headerTitle: "CallBack", path: 'callback' }} />
    <Stack.Screen name="Login" component={Login} options={{ headerTitle: "Login", path: 'login' }} />
    </NavigationContainer>
  );
}
